import React, { useEffect, useRef, useState } from 'react';

const Game = () => {
  const canvasRef = useRef(null);
  const [snake, setSnake] = useState([{ x: 50, y: 50 }]);
  const [foods, setFoods] = useState(generateFood(5)); // 5 yemle başlatıyoruz
  const [snakeColor, setSnakeColor] = useState('');
  const [playerName, setPlayerName] = useState('');
  const [gameStarted, setGameStarted] = useState(false);
  const snakeSize = 20;
  const speed = 2; // Yavaş hareket için hız
  let dx = speed;
  let dy = 0;

  // 5 adet rastgele konumda yem oluşturma fonksiyonu
  function generateFood(count) {
    const newFoods = [];
    for (let i = 0; i < count; i++) {
      newFoods.push({ 
        x: Math.random() * window.innerWidth, 
        y: Math.random() * window.innerHeight 
      });
    }
    return newFoods;
  }

  useEffect(() => {
    if (!gameStarted) return;

    const canvas = canvasRef.current;
    const context = canvas.getContext('2d');

    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;

    const handleKeydown = (e) => {
      switch (e.key) {
        case 'ArrowUp':
          dx = 0;
          dy = -speed;
          break;
        case 'ArrowDown':
          dx = 0;
          dy = speed;
          break;
        case 'ArrowLeft':
          dx = -speed;
          dy = 0;
          break;
        case 'ArrowRight':
          dx = speed;
          dy = 0;
          break;
        default:
          break;
      }
    };

    const gameLoop = () => {
      const head = { x: snake[0].x + dx, y: snake[0].y + dy };

      // Duvar çarpması kontrolü - Tam ters yöne dön
      if (head.x < 0 || head.x > canvas.width) {
        dx = -dx;
      }
      if (head.y < 0 || head.y > canvas.height) {
        dy = -dy;
      }

      // Yiyecek ile çarpışma kontrolü
      foods.forEach((food, index) => {
        if (Math.abs(head.x - food.x) < snakeSize && Math.abs(head.y - food.y) < snakeSize) {
          setFoods((prevFoods) => prevFoods.filter((_, i) => i !== index)); // Yemi kaldır
          setFoods((prevFoods) => [...prevFoods, { 
            x: Math.random() * canvas.width, 
            y: Math.random() * canvas.height 
          }]); // Yeni bir yem ekle
        }
      });

      snake.pop();
      snake.unshift(head);

      // Çizim işlemi
      context.clearRect(0, 0, canvas.width, canvas.height);

      // Yılanı çiz
      snake.forEach((segment) => {
        context.beginPath();
        context.arc(segment.x, segment.y, snakeSize / 2, 0, 2 * Math.PI);
        context.fillStyle = snakeColor || 'green';
        context.fill();
        context.strokeStyle = 'darkgreen';
        context.stroke();
      });

      // Yemleri çiz
      foods.forEach((food) => {
        context.beginPath();
        context.arc(food.x, food.y, snakeSize / 2, 0, 2 * Math.PI);
        context.fillStyle = 'red';
        context.fill();
      });

      requestAnimationFrame(gameLoop);
    };

    window.addEventListener('keydown', handleKeydown);
    gameLoop();

    return () => {
      window.removeEventListener('keydown', handleKeydown);
    };
  }, [gameStarted, snakeColor, snake, foods]);

  // Oyun başlatma fonksiyonu
  const startGame = () => {
    if (playerName && snakeColor) {
      setGameStarted(true);
    } else {
      alert('Lütfen isminizi ve yılanın rengini seçin.');
    }
  };

  return (
    <div>
      {!gameStarted && (
        <div>
          <h2>Oyun Başlamadan Önce Bilgilerinizi Girin</h2>
          <label>
            İsim:
            <input
              type="text"
              value={playerName}
              onChange={(e) => setPlayerName(e.target.value)}
              placeholder="Oyuncu ismi"
            />
          </label>
          <br />
          <label>
            Yılanın Rengi:
            <input
              type="color"
              value={snakeColor}
              onChange={(e) => setSnakeColor(e.target.value)}
            />
          </label>
          <br />
          <button onClick={startGame} disabled={!playerName || !snakeColor}>
            Play
          </button>
        </div>
      )}
      {gameStarted && <canvas ref={canvasRef} />}
    </div>
  );
};

export default Game;
